import React, { useState, useRef } from 'react';

// Virtual Dyno Room that processes REAL user CSV files
const RealCSVVirtualDyno = () => {
  const [csvFile, setCsvFile] = useState(null);
  const [csvData, setCsvData] = useState([]);
  const [dynoResults, setDynoResults] = useState(null);
  const [isRunning, setIsRunning] = useState(false);
  const [currentDataPoint, setCurrentDataPoint] = useState(0);
  const [virtualDynoSettings, setVirtualDynoSettings] = useState({
    dynoType: 'mustang_md250',
    temperature: 75,
    humidity: 45,
    altitude: 500,
    runs: 1
  });
  const fileInputRef = useRef(null);

  // Dyno characteristics
  const dynoTypes = {
    mustang_md250: {
      name: "Mustang MD250 (Load Bearing)",
      correction: 1.0,
      variance: 0.02,
      heatSoak: 0.98
    },
    dynojet_248c: {
      name: "DynoJet 248C (Inertial)", 
      correction: 1.15,
      variance: 0.03,
      heatSoak: 0.96
    },
    awd_dyno: {
      name: "AWD Dyno (All-Wheel)",
      correction: 0.95,
      variance: 0.04,
      heatSoak: 0.97
    }
  };

  // Parse uploaded CSV file
  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (!file) return;
    
    setCsvFile(file);
    
    const reader = new FileReader();
    reader.onload = (e) => {
      const csv = e.target.result;
      const lines = csv.split('\n');
      const headers = lines[0].split(',').map(h => h.trim());
      
      const data = lines.slice(1)
        .filter(line => line.trim().length > 0)
        .map(line => {
          const values = line.split(',');
          const row = {};
          headers.forEach((header, index) => {
            row[header] = values[index]?.trim();
          });
          return row;
        })
        .filter(row => {
          // Filter for valid dyno data (like your C# backend does)
          const rpm = parseInt(row['RPM (RPM)'] || row['RPM'] || row['Engine Speed']);
          const maf = parseFloat(row['Mass Airflow (g/s)'] || row['MAF'] || row['Mass Airflow']);
          const load = parseFloat(row['Calculated Load (Load)'] || row['Load'] || row['Engine Load']);
          
          return rpm > 2000 && maf > 5 && load > 0.15;
        });
      
      setCsvData(data);
      console.log(`Loaded ${data.length} valid data points from CSV`);
    };
    
    reader.readAsText(file);
  };

  // Apply virtual dyno physics to real data
  const applyVirtualDynoPhysics = (dataPoint, index) => {
    const dyno = dynoTypes[virtualDynoSettings.dynoType];
    
    // Environmental correction (SAE J1349 simplified)
    const tempCorrection = Math.sqrt(537.67 / (virtualDynoSettings.temperature + 459.67));
    const humidityCorrection = 1 - (virtualDynoSettings.humidity / 100 * 0.047);
    const altitudeCorrection = 1 - (virtualDynoSettings.altitude * 0.000035);
    const envCorrection = tempCorrection * humidityCorrection * altitudeCorrection;
    
    // Heat soak effect
    const heatSoak = Math.pow(dyno.heatSoak, virtualDynoSettings.runs - 1);
    
    // Dyno variance (realistic noise)
    const variance = 1 + (Math.random() - 0.5) * 2 * dyno.variance;
    
    // Calculate base HP from MAF (like your backend algorithm)
    const rpm = parseInt(dataPoint['RPM (RPM)'] || dataPoint['RPM'] || dataPoint['Engine Speed']);
    const maf = parseFloat(dataPoint['Mass Airflow (g/s)'] || dataPoint['MAF'] || dataPoint['Mass Airflow']);
    const load = parseFloat(dataPoint['Calculated Load (Load)'] || dataPoint['Load'] || dataPoint['Engine Load']);
    const boost = parseFloat(dataPoint['Boost (psi)'] || dataPoint['Boost'] || dataPoint['Manifold Pressure']) || 0;
    
    // Base calculation (simplified version of your C# algorithm)
    let baseHP = maf * 1.1;
    baseHP *= Math.min(load * 1.2, 1.0);
    
    // Apply all corrections
    const finalHP = baseHP * envCorrection * heatSoak * dyno.correction * variance;
    const finalTorque = rpm > 0 ? (finalHP * 5252) / rpm : 0;
    
    return {
      rpm,
      hp: Math.max(finalHP, 0),
      torque: Math.max(finalTorque, 0),
      boost,
      maf,
      load,
      originalData: dataPoint
    };
  };

  // Run virtual dyno with real CSV data
  const runVirtualDyno = async () => {
    if (!csvData.length) {
      alert('Please upload a CSV file first!');
      return;
    }
    
    setIsRunning(true);
    setCurrentDataPoint(0);
    
    // Process each data point with virtual dyno physics
    const processedData = csvData.map((dataPoint, index) => 
      applyVirtualDynoPhysics(dataPoint, index)
    );
    
    // Simulate real-time dyno run
    for (let i = 0; i < processedData.length; i++) {
      setCurrentDataPoint(i);
      await new Promise(resolve => setTimeout(resolve, 150)); // 150ms per point
    }
    
    // Calculate peaks
    const peaks = {
      maxHP: Math.max(...processedData.map(d => d.hp)),
      maxTorque: Math.max(...processedData.map(d => d.torque)),
      maxHPRpm: processedData.find(d => d.hp === Math.max(...processedData.map(p => p.hp)))?.rpm,
      maxTorqueRpm: processedData.find(d => d.torque === Math.max(...processedData.map(p => p.torque)))?.rpm,
      maxBoost: Math.max(...processedData.map(d => d.boost))
    };
    
    setDynoResults({
      processedData,
      peaks,
      settings: virtualDynoSettings,
      fileName: csvFile.name
    });
    
    setIsRunning(false);
    
    // Optionally send to C# backend for comparison
    await sendToBackend();
  };

  // Send to your C# backend for official results
  const sendToBackend = async () => {
    if (!csvFile) return;
    
    try {
      const formData = new FormData();
      formData.append('File', csvFile);
      formData.append('CarPresetKey', 'mazdaspeed3'); // Could be user-selectable
      formData.append('Weight', '3200');
      formData.append('Gear', '4');
      formData.append('Notes', `Virtual dyno: ${virtualDynoSettings.dynoType}`);
      formData.append('IsPublic', 'false');
      
      const response = await fetch('http://localhost:5038/api/dyno/upload', {
        method: 'POST',
        body: formData
      });
      
      if (response.ok) {
        const backendResults = await response.json();
        console.log('C# Backend Results:', backendResults);
        // Could compare virtual vs backend results here
      }
    } catch (error) {
      console.log('Backend not available, using virtual results only');
    }
  };

  const resetDyno = () => {
    setDynoResults(null);
    setCurrentDataPoint(0);
    setVirtualDynoSettings(prev => ({ ...prev, runs: 1 }));
  };

  const runAgain = () => {
    setVirtualDynoSettings(prev => ({ ...prev, runs: prev.runs + 1 }));
    runVirtualDyno();
  };

  const currentData = dynoResults?.processedData[currentDataPoint];

  return (
    <div style={{ padding: '20px', maxWidth: '1400px', margin: '0 auto' }}>
      <h1>üèÅ Virtual Dyno Experience - Real CSV Data</h1>
      
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: '1fr 1fr 1fr', 
        gap: '20px',
        marginBottom: '20px'
      }}>
        
        {/* File Upload */}
        <div style={{ 
          border: '2px dashed #007bff', 
          padding: '20px', 
          borderRadius: '8px',
          textAlign: 'center',
          backgroundColor: csvFile ? '#e8f5e8' : '#f8f9ff'
        }}>
          <h3>üìÅ Upload Your Datalog</h3>
          <input 
            type="file" 
            accept=".csv"
            onChange={handleFileUpload}
            ref={fileInputRef}
            style={{ display: 'none' }}
          />
          <button 
            onClick={() => fileInputRef.current.click()}
            style={{
              padding: '10px 20px',
              backgroundColor: '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
              fontSize: '16px'
            }}
          >
            {csvFile ? '‚úÖ Change File' : 'üìÇ Select CSV File'}
          </button>
          
          {csvFile && (
            <div style={{ marginTop: '10px', fontSize: '14px' }}>
              <p><strong>File:</strong> {csvFile.name}</p>
              <p><strong>Data Points:</strong> {csvData.length}</p>
            </div>
          )}
        </div>

        {/* Virtual Dyno Settings */}
        <div style={{ 
          border: '1px solid #ddd', 
          padding: '15px', 
          borderRadius: '8px',
          backgroundColor: '#f9f9f9'
        }}>
          <h3>üîß Virtual Dyno Setup</h3>
          
          <label>Dyno Type:</label>
          <select 
            value={virtualDynoSettings.dynoType}
            onChange={(e) => setVirtualDynoSettings(prev => ({
              ...prev, dynoType: e.target.value
            }))}
            style={{ width: '100%', margin: '5px 0 10px 0', padding: '5px' }}
          >
            {Object.entries(dynoTypes).map(([key, dyno]) => (
              <option key={key} value={key}>{dyno.name}</option>
            ))}
          </select>
          
          <label>Temperature: {virtualDynoSettings.temperature}¬∞F</label>
          <input 
            type="range" 
            min="50" 
            max="110" 
            value={virtualDynoSettings.temperature}
            onChange={(e) => setVirtualDynoSettings(prev => ({
              ...prev, temperature: parseInt(e.target.value)
            }))}
            style={{ width: '100%', margin: '5px 0 10px 0' }}
          />
          
          <label>Humidity: {virtualDynoSettings.humidity}%</label>
          <input 
            type="range" 
            min="10" 
            max="90" 
            value={virtualDynoSettings.humidity}
            onChange={(e) => setVirtualDynoSettings(prev => ({
              ...prev, humidity: parseInt(e.target.value)
            }))}
            style={{ width: '100%', margin: '5px 0 10px 0' }}
          />
          
          <p><strong>Run #:</strong> {virtualDynoSettings.runs}</p>
          <p><strong>Heat Soak:</strong> {(Math.pow(dynoTypes[virtualDynoSettings.dynoType].heatSoak, virtualDynoSettings.runs - 1) * 100).toFixed(1)}%</p>
        </div>

        {/* Live Dyno Display */}
        <div style={{ 
          border: '2px solid #28a745', 
          padding: '15px', 
          borderRadius: '8px',
          backgroundColor: isRunning ? '#fff3cd' : '#f8fff8'
        }}>
          <h3>üìä {isRunning ? 'DYNO RUNNING...' : 'Virtual Dyno'}</h3>
          
          {isRunning && currentData && (
            <div style={{ 
              backgroundColor: '#ffeb3b', 
              padding: '10px', 
              borderRadius: '5px',
              textAlign: 'center'
            }}>
              <div style={{ fontSize: '24px', fontWeight: 'bold' }}>
                {currentData.rpm} RPM
              </div>
              <div style={{ fontSize: '18px' }}>
                {currentData.hp.toFixed(1)} HP | {currentData.torque.toFixed(1)} lb-ft
              </div>
              <div style={{ fontSize: '14px' }}>
                Boost: {currentData.boost.toFixed(1)} PSI | MAF: {currentData.maf.toFixed(1)} g/s
              </div>
              <div style={{ 
                width: '100%', 
                height: '10px', 
                backgroundColor: '#ddd', 
                borderRadius: '5px',
                marginTop: '10px'
              }}>
                <div style={{ 
                  width: `${(currentDataPoint / csvData.length) * 100}%`,
                  height: '100%',
                  backgroundColor: '#28a745',
                  borderRadius: '5px',
                  transition: 'width 0.1s'
                }}></div>
              </div>
            </div>
          )}
          
          {dynoResults && !isRunning && (
            <div style={{ textAlign: 'center' }}>
              <h4>üèÜ Peak Results</h4>
              <p><strong>{dynoResults.peaks.maxHP.toFixed(1)} HP</strong> @ {dynoResults.peaks.maxHPRpm} RPM</p>
              <p><strong>{dynoResults.peaks.maxTorque.toFixed(1)} lb-ft</strong> @ {dynoResults.peaks.maxTorqueRpm} RPM</p>
              <p><strong>Max Boost:</strong> {dynoResults.peaks.maxBoost.toFixed(1)} PSI</p>
              <p style={{ fontSize: '12px' }}>
                Dyno: {dynoTypes[dynoResults.settings.dynoType].name}<br/>
                Correction: {dynoTypes[dynoResults.settings.dynoType].correction}x
              </p>
            </div>
          )}
        </div>
      </div>

      {/* Control Buttons */}
      <div style={{ textAlign: 'center', marginBottom: '20px' }}>
        <button 
          onClick={runVirtualDyno}
          disabled={!csvData.length || isRunning}
          style={{
            padding: '15px 30px',
            backgroundColor: isRunning ? '#ccc' : '#dc3545',
            color: 'white',
            border: 'none',
            borderRadius: '8px',
            fontSize: '18px',
            fontWeight: 'bold',
            marginRight: '10px',
            cursor: isRunning ? 'not-allowed' : 'pointer'
          }}
        >
          {isRunning ? 'üèÉ DYNO RUNNING...' : 'üöÄ START VIRTUAL DYNO'}
        </button>
        
        {dynoResults && !isRunning && (
          <>
            <button 
              onClick={runAgain}
              style={{
                padding: '10px 20px',
                backgroundColor: '#ffc107',
                color: 'black',
                border: 'none',
                borderRadius: '5px',
                marginRight: '10px',
                cursor: 'pointer'
              }}
            >
              üîÑ Run Again (Heat Soak)
            </button>
            
            <button 
              onClick={resetDyno}
              style={{
                padding: '10px 20px',
                backgroundColor: '#6c757d',
                color: 'white',
                border: 'none',
                borderRadius: '5px',
                cursor: 'pointer'
              }}
            >
              üîÑ Reset Session
            </button>
          </>
        )}
      </div>

      {/* Instructions */}
      <div style={{ 
        padding: '20px', 
        backgroundColor: '#e3f2fd', 
        borderRadius: '8px',
        marginTop: '20px'
      }}>
        <h4>üéÆ How to Use Your Virtual Dyno:</h4>
        <ol>
          <li><strong>Upload your real CSV datalog</strong> (AccessPort, Cobb, MHD, etc.)</li>
          <li><strong>Choose dyno type</strong> - Different dynos read differently</li>
          <li><strong>Set environmental conditions</strong> - Hot weather = less power</li>
          <li><strong>Watch your car "run" on the virtual dyno</strong> - Real-time simulation</li>
          <li><strong>Run multiple pulls</strong> - See heat soak effects</li>
        </ol>
        
        <p><strong>üéØ This uses YOUR real data</strong> but simulates different dyno types and conditions!</p>
        
        <div style={{ 
          backgroundColor: '#fff3cd', 
          padding: '10px', 
          borderRadius: '5px',
          marginTop: '10px'
        }}>
          <strong>Expected CSV Columns:</strong> RPM, Mass Airflow (g/s), Boost (psi), Calculated Load, 
          plus optional AFR, Intake Temp, Knock Retard
        </div>
      </div>
    </div>
  );
};

export default RealCSVVirtualDyno;
